import medog from '../assets/jpg/me_dog.jpg';

export const aboutData = {
    title: "Who I am",
    description1: "I am a second year Master's student at the Johns Hopkins University studying Computer Science. I graduated from IIIT Delhi, India with a Bachelors in Computer Science in 2019 and worked for 3 years as a Senior Software Developer at MakeMyTrip before coming to the States for my Masters.",
    description2:<p>When I'm not coding, I like drawing, hanging out with friends, traveling, and watching TV shows and movies. I'm a big fan of Bollywood and always say hi to dogs I meet :) <br/><br/> PS this isn't my dog (his name is Lincoln).</p>,
    image: medog
}
